import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Breadcrumb from './../components/widget/Breadcrumb';

const listsportfolio = [
	{
	 	id: 1,
		image: 'assets/img/portfolio/portfolio-1.jpg',
		type: 'App',
	},
	{
	 	id: 2,
		image: 'assets/img/portfolio/portfolio-2.jpg',
		type: 'Web',
	},
	{
	 	id: 3,
		image: 'assets/img/portfolio/portfolio-3.jpg',
		type: 'App',
	},
	{
	 	id: 4,
		image: 'assets/img/portfolio/portfolio-4.jpg',
		type: 'Card',
	},
	{
	 	id: 5,
		image: 'assets/img/portfolio/portfolio-5.jpg',
		type: 'Web',
	},
	{
	 	id: 6,
		image: 'assets/img/portfolio/portfolio-6.jpg',
		type: 'App',
	},
	{
	 	id: 7,
		image: 'assets/img/portfolio/portfolio-7.jpg',
		type: 'Card',
	},
	{
	 	id: 8,
		image: 'assets/img/portfolio/portfolio-8.jpg',
		type: 'Card',
	},
	{
	 	id: 9,
		image: 'assets/img/portfolio/portfolio-9.jpg',
		type: 'Web',
	}
];

function ListFilter({ filterItem, setItem, portfolioItems }) {
	return (
		<>
			{
				portfolioItems.map((val, id) => (
					<li
						key={id}
						onClick={() => filterItem(val)}
						className="filter-active"
					>{val}</li>
				))
			}
			<li
				onClick={() => setItem(listsportfolio)}
				className="filter-active"
			>All</li>
		</>
	)
}

function Card({items}) {
	return (
		<>
				{items.map((item, idx) => (
			  <div key={item.idx} className={`col-lg-4 col-md-4 portfolio-item filter-${item.type.toLowerCase()}`}>
			    <div className="portfolio-wrap">
			      <img src={item.image} className="img-fluid" alt="" />
			      <div className="portfolio-info">
			        <h4>{item.type} 1</h4>
			        <p>{item.type}</p>
			        <div className="portfolio-links">
			          <a href={item.image} data-gallery="portfolioGallery" className="portfolio-lightbox" title={`${item.type}`}><i className="bx bx-plus"></i></a>
			          <Link to={`${item.id}`} title="More Details"><i className="bx bx-link"></i></Link>
			        </div>
			      </div>
			    </div>
			  </div>
				))}
		</>
	)
}

function Portfolio() {

	// let liststype = listsportfolio.map((item, index) => item.type)
	/*
	let duplicates = liststype.reduce(function(acc, el, i, arr) {
		if (arr.indexOf(el) !== i && acc.indexOf(el) < 0) {
			acc.push(el);
		}
		return acc;
	}, []);
	*/

	const [item, setItem] = useState(listsportfolio);
	const portfolioItems = [...new Set(listsportfolio.map(val => val.type))];

	const filterItem = (currPort) => {
		const newItem = listsportfolio.filter(newVal => newVal.type === currPort);
		setItem(newItem);
	}

	return (
		<main id="main">
			<Breadcrumb page="Portfolio" description="Est dolorum ut non facere possimus quibusdam eligendi voluptatem. Quia id aut similique quia voluptas sit quaerat debitis. Rerum omnis ipsam aperiam consequatur laboriosam nemo harum praesentium." />

		  <section id="portfolio" className="portfolio">
		    <div className="container">

		      <div className="row">
		        <div className="col-lg-12 d-flex justify-content-center">
		          <ul id="portfolio-flters">
								<ListFilter
									portfolioItems={portfolioItems}
									setItem={setItem}
									filterItem={filterItem}
								/>
		          </ul>
		        </div>
		      </div>

		      <div className="row portfolio-container">
						<Card items={items} />
		      </div>
		    </div>
		  </section>

		</main>
	)
}

export default Portfolio;


